import React from 'react';
import './Experience.css';

function Experience() {
  return (
    <>
      <div className='experience-containter'>
        <h1 className='experience-heading'>
          She is uniquely experienced to <br />
          lead projects at the intersection <br />
          social impact, culture, digital <br />
          media, and policy.
        </h1>
      </div>
    </>
  );
}

export default Experience;
